import React from 'react';

function ViewResume({ resume, onDeleteResume, onBack }) {
  if (!resume) {
    return <p>No résumé data available to display.</p>;
  }

  const handleDelete = () => {
    if (window.confirm(`Are you sure you want to delete the résumé for ${resume.fullName}?`)) {
      onDeleteResume(resume.id); // Call the delete function
      onBack(); // Navigate back after deletion
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>View Résumé</h2>
      {resume.photo && (
        <div style={styles.photoContainer}>
          <img
            src={resume.photo}
            alt="Uploaded"
            style={styles.photo}
          />
        </div>
      )}
      <div style={styles.content}>
        <p><strong>Full Name:</strong> {resume.fullName}</p>
        <p><strong>Phone Number:</strong> {resume.phoneNumber}</p>
        <p><strong>Email:</strong> {resume.email}</p>
        <p><strong>LinkedIn:</strong> <a href={resume.linkedin} target="_blank" rel="noopener noreferrer">{resume.linkedin}</a></p>
        <p><strong>Portfolio:</strong> <a href={resume.portfolio} target="_blank" rel="noopener noreferrer">{resume.portfolio}</a></p>
        <p><strong>Summary:</strong> {resume.summary}</p>
        <p><strong>Skills:</strong> {resume.skills}</p>
        <p><strong>Work Experience:</strong> {resume.workExperience}</p>
        <p><strong>Education:</strong> {resume.education}</p>
        <p><strong>Certifications:</strong> {resume.certifications}</p>
        <p><strong>Projects:</strong> {resume.projects}</p>
        <p><strong>Additional Information:</strong> {resume.additional}</p>
      </div>
      <div style={styles.buttonContainer}>
        <button onClick={onBack} style={styles.button}>Back</button>
        <button onClick={handleDelete} style={{ ...styles.button, ...styles.deleteButton }}>Delete</button>
      </div>
    </div>
  );
}

const styles = {
  container: {
    maxWidth: '800px',
    margin: '0 auto',
    padding: '20px',
    borderRadius: '8px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    backgroundColor: '#fff',
    fontFamily: 'Arial, sans-serif',
  },
  heading: {
    textAlign: 'center',
    marginBottom: '20px',
    color: '#333',
  },
  photoContainer: {
    textAlign: 'center',
    marginBottom: '20px',
  },
  photo: {
    width: '150px',
    height: '150px',
    borderRadius: '50%',
    objectFit: 'cover',
  },
  content: {
    lineHeight: '1.6',
    color: '#555',
  },
  buttonContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    marginTop: '20px',
  },
  button: {
    padding: '10px 20px',
    fontSize: '16px',
    borderRadius: '5px',
    border: 'none',
    cursor: 'pointer',
    backgroundColor: '#007BFF',
    color: '#fff',
    transition: 'background-color 0.3s',
  },
  deleteButton: {
    backgroundColor: '#DC3545',
  },
};

export default ViewResume;
